import React from 'react';
import * as S from "./project-header.styles"
import Text from "../common/Text";
import {Link} from 'react-router-dom';
import {Blob} from "react-blob";





const Project_Header = ({color, title, expertise, technologies, site, image}) => {
    return (
        <S.Project_Header_Wrapper>
            <S.Project_Title_Wrapper>
                <Text
                    as={"h2"}
                    color={color}
                    fontSize={"80px"}
                    fontWeight={600}
                    lineHeight={"84.5%"}
                >{title}</Text>
                <div>
                    <Text
                        as={"h3"}
                        color={color}
                        fontSize={"12px"}
                        fontWeight={800}
                        lineHeight={"98.5%"}
                    >EXPERTISE</Text>
                    <Text>
                        {expertise}
                    </Text>
                </div>
                <div>
                    <Text
                        as={"h3"}
                        color={color}
                        fontSize={"12px"}
                        fontWeight={800}
                        lineHeight={"98.5%"}
                    >Platform</Text>
                    <Text>
                        {expertise}
                    </Text>
                </div>
                <div>
                    <Text
                        as={"h3"}
                        color={color}
                        fontSize={"12px"}
                        fontWeight={800}
                        lineHeight={"98.5%"}
                    >Technology</Text>
                    <Text>
                        {technologies}
                    </Text>
                </div>
                <div>
                    <Text
                        as={"h3"}
                        color={color}
                        fontSize={"12px"}
                        fontWeight={800}
                        lineHeight={"98.5%"}
                    >Link</Text>
                    <Text>
                        <Link to={site}>
                            <Text
                            textDecoration={"underline"}
                            fontSize={"16px"}
                            color={color}
                            >
                                See Project
                            </Text>
                        </Link>
                    </Text>
                </div>

            </S.Project_Title_Wrapper>
            <Blob size="100vh"
                  style={{
                      position: 'absolute',
                      top: '-15%',
                      right: '-15%',
                      zIndex: -1,

                      backgroundAttachment: 'fixed',
                      color: 'white',
                      backgroundSize: "cover",
                      fontSize: '50vh',
                        backgroundImage:`url(${image})`
                  }}

            />
        </S.Project_Header_Wrapper>

    )
}

export default Project_Header;
